import { useState } from "react";
import { Link } from "react-router-dom";
import { Container, Row } from "../GlobalStyle";
import * as H from "./style";
import "./header.scss";
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faBars, faTimes } from '@fortawesome/free-solid-svg-icons';

function Header() {
    const [show, setShow] = useState(false);
    // const styles = {
    //     popup: {
    //         display: show ? "block" : "none"
    //     }
    // };
    const showMenu = () => {
        setShow(!show);
    }
    return (
        <>
            <H.Header>
                <Container>
                    <Row spaceBetween alignItemsCenter>
                        <H.LogoDiv>
                            <a href="/">
                                <H.Logo alt="site-logo" src="https://movephysiotherapy.com.au/wp-content/uploads/2021/05/Move_P_F_Logo-Black_Blue-removebg-preview.png"></H.Logo>
                            </a>
                        </H.LogoDiv>
                        <H.MenuWrapper>
                            <H.MenuList>
                                <H.MenuItem>
                                    <Link to="/">Home</Link>
                                </H.MenuItem>
                                <H.MenuItem>
                                    <Link to="/about">About</Link>
                                </H.MenuItem>
                                <H.MenuItem>
                                    <Link to="/services">Services</Link>
                                </H.MenuItem>
                                <H.MenuItem>
                                    <Link to="/conditions">Conditions</Link>
                                </H.MenuItem>
                                <H.MenuItem>
                                    <Link to="/blog">Blog</Link>
                                </H.MenuItem>
                                <H.MenuItem>
                                    <Link to="/projects">Projects</Link>
                                </H.MenuItem>
                                <H.MenuItem>
                                    <Link to="/contact">Contact</Link>
                                </H.MenuItem>
                            </H.MenuList>
                        </H.MenuWrapper>
                        <H.MenuButton
                            className="menuBtn"
                            onClick={showMenu}
                        >
                            <FontAwesomeIcon icon={show ? faTimes: faBars} />
                        </H.MenuButton>
                    </Row>
                    <H.MobileMenuWrapper style={{display: show ? "block" : "none"}}>
                        <H.MobileMenuList>
                            <H.MobileMenuItem>
                                <Link to="/">Home</Link>
                            </H.MobileMenuItem>
                            <H.MobileMenuItem>
                                <Link to="/about">About</Link>
                            </H.MobileMenuItem>
                            <H.MobileMenuItem>
                                <Link to="/services">Services</Link>
                            </H.MobileMenuItem>
                            <H.MobileMenuItem>
                                <Link to="/conditions">Conditions</Link>
                            </H.MobileMenuItem>
                            <H.MobileMenuItem>
                                <Link to="/blog">Blog</Link>
                            </H.MobileMenuItem>
                            <H.MobileMenuItem>
                                <Link to="/projects">Projects</Link>
                            </H.MobileMenuItem>
                            <H.MobileMenuItem>
                                <Link to="/contact">Contact</Link>
                            </H.MobileMenuItem>
                        </H.MobileMenuList>
                    </H.MobileMenuWrapper>
                </Container>
            </H.Header>
        </>
    );
}

export default Header;
